import Link from 'next/link'
const Index = () => {
    return (
        <div>
            <ul>
                <li><Link href='/'><button>Home</button></Link></li>
                <li><Link href='/about'><button>About</button></Link></li>
            </ul>
            <h1>Welcome to BitsPrice</h1>
        </div>
    )
}

export default Index
